import React from 'react'
import Head from "next/head";
import AppLayout from "../components/AppLayout";
import { Form, Input } from 'antd';
const SignUp = () => {
  const onSubmit = () => {

  }

  const onChangeId = () => {

  }
  const onChangeNick = () => {

  }

  return (
    <>
      <Head>
        <title>NodeBird</title>
        <link
          rel="stylesheet"
          href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.16.2/antd.css"
        />
      </Head>
      <AppLayout>
        <Form onSubmit={onSubmit}>
          <div>
            <label htmlFor="user-id">아이디</label>
            <br />
            <Input name="user-id" required onChange={onChangeId} />

          </div>
          <div>
            <label htmlFor="user-nick">닉네임</label>
            <br />
            <Input name="user-nick" required onChange={onChangeNick} />
          </div>
          <div>
            <label htmlFor="user-nick">비밀번호</label>
            <br />
            <Input name="user-pass" type="password" required onChange={onChangePassword} />
          </div>
        </Form>
      </AppLayout>
    </>
  )
}

export default SignUp;
